import './styles.css';
import React from 'react'
import range from 'lodash/range'
import * as selectors from '../../reducers'
import { connect } from 'react-redux';

const Baby = ({babies,count}) => (
    <div className="container">
        <div className="baby">
        {
        <select id="B" name="babies">
        {range(count).map(
                (_,index) => (
                    <option value={babies[index][Object.keys(babies[index])[0]]}>5{babies[index][Object.keys(babies[index])[1]]+" "+babies[index][Object.keys(babies[index])[2]]}</option>
                )
            )}
        </select>}
        </div>
    </div>
)

export default connect(
    state => ({
        babies: selectors.getAllBabies(state)
    }),
    undefined
)(Baby)
